syntax = "proto3";

package make87_messages_ros2.jazzy.ublox_msgs.msg;

import "make87_messages_ros2/jazzy/ublox_msgs/msg/rxm_rawx_meas.proto";

message RxmRAWX {
     double rcv_tow = 1;
     uint32 week = 2;
     int32 leap_s = 3;
     uint32 num_meas = 4;
     uint32 rec_stat = 5;
     uint32 version = 6;
    repeated uint32 reserved1 = 7;
    repeated make87_messages_ros2.jazzy.ublox_msgs.msg.RxmRAWXMeas meas = 8;
}
